function Settings() {
    function option() {
        document.getElementById("window").style.display = "none"
    }
    return (
        <div className="setting">
            <h1 onClick={() => document.getElementById("window").style.display = "block"}>⚙</h1>

            <div className="window" id="window">
                <optgroup>
                    <option>Фон</option>
                    <option>Шрифт</option>
                    <option>Размер текста</option>
                </optgroup>
            </div>
        </div>
    )
}

export default Settings
